member.summary:
Specifies which columns are visible in this view. Any columns not specified will be hidden. This is an array of column indexes in the underlying table/view, or calculated columns. If you don't call this method, the default is to show all columns. The array can also contain duplicates, to show the same column multiple times. Columns will be shown in the order specified.
* columnIndexes - An array of numbers and/or objects. Numbers are column index values in the underlying table/view. Objects are descriptions of a calculated column. A calculated column creates a value on the fly for each row and adds it to the view. The object must have the following properties: o calc [function] - A function that takes two values, the DataTable that the view is built on, and the number of the row being generated, and returns a single value of type type described below. The function signature is func(dataTable, row), where dataTable is the source DataTable, and row is the index of the source data row. The function should return a single value of the type specified by type. o type [string] - The JavaScript type of the value that the calc function returns. o label [Optional, string] - An optional label to assign to this generated column. o id [Optional, string] - An optional ID to assign to this generated column. o sourceColumn - [Optional, number] The source column to use as a value; if specified, do not specify the calc or the type property. This is similar to passing in a number instead of an object, but enables you to specify a role and properties for the new column. o properties [Optional, object] - An object containing any arbitrary properties to assign to this column. If not specified, the view column will have no properties. o role [Optional, string] - A role to assign to this column. If not specified, the existing role will not be imported.
// Column 1 is a value in centimeters, and the third column is // a generated column that converts this into inches. view.setColumns([0,1,{calc:myFunc, type:'number', label:'Height in Inches'}]); function myFunc(dataTable, rowNum){ return Math.floor(dataTable.getValue(rowNum, 1) / 2.54); }
